import Popup from "./Popup"
export default function InfoTooltip(props){
  return(
    <Popup
			className={`popup popup_type_${props.name} ${
				props.isOpen ? "popup_opened" : ""
			}`}
			onClose={props.onClose}
			isOpen={props.isOpen}
		>

    </Popup>
  )
}
